Агентство недвижимости «Vectorprom» открывает набор сотрудников с опытом или без опыта в сфере недвижимости, которые хотят начать или продолжить свою карьеру в стабильном и высокооплачиваемом направлении.
Уникальность нашей Компании в том, что мы предлагаем сотрудничество с активной поддержкой, а также обучение с нуля.

ЧТО МЫ ВАМ ПРЕДЛАГАЕМ:

* Возможность зарабатывать (оклад + Ваш KPI);
* Личное рабочее место в комфортном офисе;
* Научиться профессиональным навыкам продаж;
* Бесплатное обучение, тренинги, мастер-классы, инструменты для продаж;
* Сопровождение на всех этапах во время стажировки;
* Возможность международных командировок.


ЧТО ТРЕБУЕТСЯ ОТ ВАС:

• Готовность обучаться и познавать: область недвижимости, как выстраивать деловые отношения с клиентами;
• Желание стать специалистом в профессии, продавать свои навыки;
• Быть дисциплинированным, и порядочным (это твоя репутация и показатели);
• Иметь организаторские способности (тактичность, инициативность);
• Нацелиться на результат, и на крупные чеки;


ЧТО НУЖНО БУДЕТ ДЕЛАТЬ:

• Работать с электронными базами клиентов;
• Анализировать рынок недвижимости;
• Проводить консультации клиентам;
• Привлекать клиентов, и проводить с ними деловые встречи;
• Производить подбор и организацию показов объектов;
• Презентовать районы города и объекты недвижимости;


ГРАФИК РАБОТЫ:

• Мы работаем каждый день с понедельника по пятницу с  10.00 до 18:00 (выезд на показы);


ПОЖЕЛАНИЯ К НАШИМ КАНДИДАТАМ:

• Ответственность, инициативность, презентабельность;
• Желание обучаться и самосовершенствоваться;
• Опыт работы приветствуется на следующих позициях, но не обязателен: специалист продажи недвижимости, агент по недвижимости, страховой агент, риэлтор, экономист, маркетолог, юрист, менеджер по продажам, колл-центр, оператор контактного центра.



ЕСЛИ ВЫ ИЩЕТЕ КОМАНДУ ЕДИНОМЫШЛЕННИКОВ, МОЩНУЮ ПОДДЕРЖКУ И УМЕЕТЕ РАБОТАТЬ В КОМАНДЕ, ТО НАШИ ДВЕРИ ДЛЯ ВАС ОТКРЫТЫ!

Приходите на интервью и проверьте сами. Ждем ваш отклик!

